const Navbar = () => {
    return (
        <div className="bg-indigo-500 mb-16 flex items-center justify-center w-full h-20">
                <nav className="flex text-white">
                    <div className="mr-10">
                        <ul className="flex">
                            <li className="ml-1 mr-4 text-5xl font-semibold">Gestion Usuarios</li>
                        </ul>
                </div>
            </nav>
        </div>
    )
}

export default Navbar;
